import React from "react";
import Card1 from 'react-bootstrap/Card';
import "./Card.scss";

const Card = (props) => {
    return (
        <>
        <Card1 style={{ width: '18rem' }}>
            <Card1.Body>
                <Card1.Title>{props.book.title}</Card1.Title>
                <Card1.Text>{props.book.description}</Card1.Text>
                <Card1.Text>{props.book.author}</Card1.Text>
            </Card1.Body>
        </Card1>
        </>
    )
}

export default Card;
